import React from 'react'
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';



function ManagePost() {
  return (
    <>
    <title>
    <Box
      sx={{
        width: 500,
        maxWidth: '100%',
      }}
    >
      <TextField fullWidth label="fullWidth" id="fullWidth" />
    </Box>


    </title>
    
    <body>

    <Box
      sx={{
        width: 500,
        maxWidth: '100%',
      }}
    >
      <TextField multiline maxRows={4} variant="standard" fullWidth label="fullWidth" id="fullWidth" />
    </Box>
        
    </body>
    
    
    </>
  )
}

export default ManagePost
